# https://leetcode.com/problems/two-sum-ii-input-array-is-sorted/

def two_sum(nums, target)
  pair = return_pair(nums, target)
  pair.map do |n|
    i = nums.index(n)
    nums[i] = "*"
    i + 1
  end
end

def return_pair(nums, target)
  arr = nums.uniq

  arr.each do |x|
    arr.each do |y|
      return [x, y] if target == x + y
    end
  end
end

p two_sum([2, 7, 11, 15], 9) == [1, 2]

p two_sum([0, 0, 3, 4], 0) == [1, 2]

